import React from 'react';
import './App.css';
import ProjectList from './components/ProjectList/ProjectList'

import fetchApi from './services/fetchApi'

class App extends React.Component {

  componentDidMount(){
    fetchApi()
  }

  render(){
    return (
      <div className="App">
        <h2>Joejoe</h2>
        <ProjectList />
      </div>
    )
  }
}

export default App;
